    false,nt"url": null,nt"notes": "The natural color, ONE-foot orthophotos
    to be mapped consists of 1,802 cells (approximately 1,616 square miles) flown with
    a Z/I Intergraph DMC airborne digital sensor under FDOR contract entitled "FY 2012
    Digital Orthophoto (Dade Orthophoto)" and Purchase Order P0011. The flight season
    was from December 15, 2011 through March 15, 2012. The flight dates are as follows:
    January 6, 2012; January 15, 2012; January 21, 2012; and April 12, 2012. All images
    were collected between 10:00 AM to 2:30 PM to minimize shadows. All images were
    obtained under cloud free conditions. Please see the survey report for the accuracy
    report.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
